import React from "react";
import "./header.css";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <div>
      <>
        <header>
          <nav>
            <div className="left">
              <h1>Jeel Gandhi</h1>
            </div>
            <div className="right">
              <ul>
                <li>
                  <NavLink to="/">Home</NavLink>
                </li>
                <li></li>
                <li></li>
                <li></li>
              </ul>
            </div>
          </nav>
        </header>
      </>
    </div>
  );
};

export default Header;
